import React, { useState, useEffect } from 'react'
import '../Header/Header.css'
import WhiteLogo from '../Assets/white-logo.svg'


/**
* @author
* @function Header
**/

const Header = (props) => {
    const [changeTitle, setChangeTitle] = useState({
        title: 'Dashboard/Analytics'
    })

    useEffect(()=>{

    },[changeTitle])

const handle_title = (title) =>{
    setChangeTitle({
        title: `${title}`
    })
}

    return (
        <div className='header_container'>
            <div id='nav_container'>
                <div className='header_wrapper'>
                    <div className='header_info_container'>
                        <img src={WhiteLogo} alt='logo'></img>
                    </div>
                    <div className='header_info_container nav'>
                        <span onClick={handle_title('Dashboards')} className='nav_link' to='#'>Dashboard</span>
                        <span className='nav_link' to='#'>Lot Management</span>
                        <span className='nav_link' to='#'>Notification Centre</span>
                        <span className='nav_link' to='#'>Profile</span>
                    </div>
                </div> {/* End of header_wrapper */}
                <div className='header_wrapper'> 
                    <div className='changeable_titles'> 
                        <h1 id='title'>{changeTitle.title}</h1>
                    </div>
                </div>
            </div>
        </div>
    )

}

export default Header
